    this.companyControl = new FormControl();
    this.cityList = [];
    this.zoneList = [];
    this.filteredOptions = this.companyControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap(val => {
      if (val.trim() !== '') this.isCompanyLoading = true;
      return this.filter(val || '');
    }));
  }

  getAll() {
    this.apiService.getall('').subscribe(data => {});
  }

  ngOnInit() {
    this.setForm();
    this.loadCities();
    if (this.id > 0) this.setEditForm();
  }

  filter(val) {
    return this.apiService.getall(`company/getSelectCompanyList?search=${val.trim()}`).pipe(map(response => {
      const res = response;
      this.isCompanyLoading = false; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      return res;
    }));
  }

  setForm() {
    //let cDate: IMyDateModel = { isRange: false, singleDate: {}, dateRange: null };
    this.form = this.fb.group({
      'branchCode': ['', Validators.required],
      'bankName': ['', Validators.required],
      'bankNameAr': ['', Validators.required],
      'branchName': ['', Validators.required],
      'branchAddress': ['', Validators.required],
      'branchAddressAr': [''],
      'phone': ['', Validators.compose([Validators.required, this.validationService.mobileValidator //  this.validationService.numberValidator
      ])],
      'mobile': ['', Validators.compose([Validators.required, this.validationService.mobileValidator])],
      'city': ['', Validators.required],
      'zoneId': ['', Validators.required],
      'state': ['', Validators.required],
      'authorityName': ['', Validators.required],
      //'remarks': ['', Validators.required],
      'isActive': [false],
      'accountNumber': ['', Validators.required],
      'iban': ''
    });
  }

  setEditForm() {
    this.apiService.get('branch', this.id).subscribe(res => {
      if (res) {
        this.companyControl.setValue(res['companyName']);
        this.form.patchValue(res);
      }
    }); //this.form = this.fb.group({
    //  'branchCode': ['', Validators.required],
